import React, { Component } from 'react';
import './css/Home.css';

export class Home extends Component {

    render() {
        
        return (

            <div className="home">


                <section className="homeSec">
                    {this.props.items.phones.slice(0,3).map(phones =>{
                    return <div key = {phones.id} className="colorPattern">
                            <h3 id="brand"> {phones.brand}</h3>
                            <h4 id="model"> {phones.model}</h4>
                            <p className="Phoneprice">Price: {phones.price}$</p>
                            <p>{phones.camera}, {phones.battery}</p>
                            </div>        
                    })}
                </section>

            </div>

        )
    }
}

export default Home;
